import React from "react";

function Road(props) {
        return (
            <div>
                <div
                    className = {props.StylingInfo}
                    style = {{
                    height: props.height, 
                    width: props.width,
                    right: props.right,
                    left: props.left,
                    top:props.top
                    }    
                }></div>
                <div
                    className='horizontal-dash'
                    ></div>
            </div>
            
        )
}

export default Road;
